// import logo from './logo.svg';
import React from 'react';
import './App.css';
import Card from "./c";
import "bootstrap/dist/css/bootstrap.min.css";

const CardConfig = [
  {
    component:"card",
    children:[
      {
        component:"img",
        src:""
      },
      {
        component:"body",
        children:[
          {
            component:"title",
            children:"this is title"
          },
          {
            component:"text",
            children:"summary"
          },
          {
            component:"button",
            children:"Add to cart"
          }
        ]
      }
    ]
  }
]

function App() {
  return (
    <div className='App'>
      <div className='card-container'>
        {CardConfig.map(config => Card(config))}
      </div>
    </div>
  );
}

export default App;
